                    left = len(words[i - 1]) if i > 0 else None
                    right = len(words[i + 1]) if i + 1 < len(words) else None
                    cur = len(w)

                    if left is None and right is None:
                        out.append(w)
                    elif left is None:
                        if cur < right:
                            out.append(w)
                    elif right is None:
                        if cur < left:
                            out.append(w)
                    else:
                        if cur < left and cur < right:
                            out.append(w)

                return out
